    // //   <MDBCard>
    // //     <MDBCardImage src="https://mdbootstrap.com/img/Photos/Others/images/48.jpg" alt="MDBCard image cap" top hover
    // //       overlay="white-slight" />
    // //     <MDBCardBody>
    // //       <MDBCardTitle tag="h5">Panel title</MDBCardTitle>
    // //       <MDBCardText>
    // //         Some quick example text to build on the card title and make up
    // //         the bulk of the card's content.
    // //       </MDBCardText>
    // //       <MDBBtn color="primary" size="md">
    // //         read more
    // //       </MDBBtn>
    // //     </MDBCardBody>
    // //   </MDBCard>

    //   <MDBCard>
    //     {/* <MDBCardImage src="https://mdbootstrap.com/img/Photos/Others/images/77.jpg" alt="MDBCard image cap" top hover */}
    //       {/* overlay="white-slight" /> */}
    //     <MDBCardBody>
    //       <MDBCardTitle tag="h5">Panel title</MDBCardTitle>
    //       <MDBCardText>
    //         Some quick example text to build on the card title and make up
    //         the bulk of the card's content.
    //       </MDBCardText>
    //       <MDBBtn color="primary" size="md">
    //         read more
    //       </MDBBtn>
    //     </MDBCardBody>
    //   </MDBCard>
    // // </MDBCardGroup>
    // // <div><h1>this is tour page</h1></div>
    <MDBFooter color="mdb-color" className="font-small lighten-3 pt-4 mt-4">
    <MDBContainer className="text-center text-md-left">
      <MDBRow className="my-4">
        <MDBCol md="4" lg="4">
          <h5 className="text-uppercase mb-4 font-weight-bold">
            MDBFooter Content
          </h5>
          <p>
            Here you can use rows and columns here to organize your footer
            content.
          </p>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Fugit,
            error amet numquam iure provident voluptate esse quasi,
            veritatis totam voluptas nostrum.{" "}
          </p>
        </MDBCol>
        <hr className="clearfix w-100 d-md-none" />
        <MDBCol md="2" lg="2" className="ml-auto">
          <h5 className="text-uppercase mb-4 font-weight-bold">About</h5>
          <ul className="list-unstyled">
            <p>
              <a href="#!">PROJECTS</a>
            </p>
            <p>
              <a href="#!">ABOUT US</a>
            </p>
            <p>
              <a href="#!">BLOG</a>
            </p>
            <p>
              <a href="#!">AWARDS</a>
            </p>
          </ul>
        </MDBCol>
        <hr className="clearfix w-100 d-md-none" />
        <MDBCol md="5" lg="3">
          <h5 className="text-uppercase mb-4 font-weight-bold">Address</h5>
          <p>
            <i className="fa fa-home mr-3" /> New York, NY 10012, US
          </p>
          <p>
            <i className="fa fa-envelope mr-3" /> info@example.com
          </p>
          <p>
            <i className="fa fa-phone mr-3" /> + 01 234 567 88
          </p>
          <p>
            <i className="fa fa-print mr-3" /> + 01 234 567 89
          </p>
        </MDBCol>
        <hr className="clearfix w-100 d-md-none" />
        <MDBCol md="2" lg="2" className="text-center">
          <h5 className="text-uppercase mb-4 font-weight-bold">
            Follow us
          </h5>
          <div className="mt-2 ">
            <a type="button" className="btn-floating btn-small btn-fb">
              <i className="fab fa-facebook-f" />
            </a>
            <a type="button" className="btn-floating btn-small btn-tw">
              <i className="fab fa-twitter" />
            </a>
            <a type="button" className="btn-floating btn-small btn-gplus">
              <i className="fab fa-google-plus" />
            </a>
            <a type="button" className="btn-floating btn-small btn-dribbble">
              <i className="fab fa-dribbble" />
            </a>
          </div>
        </MDBCol>
        <hr className="clearfix w-100 d-md-none" />
      </MDBRow>
    </MDBContainer>
    <div className="footer-copyright text-center py-3">
      <MDBContainer fluid>
        &copy; {new Date().getFullYear()} Copyright:{" "}
        <a href="https://www.MDBootstrap.com"> MDBootstrap.com </a>
      </MDBContainer>
    </div>
  </MDBFooter>
  );

}

export default Tour;
